export const OtherWallets = ({ ...props }) => {
  const column: React.CSSProperties = {
    position: "relative",
    display: "flex",
    flexDirection: "column",
    gap: 2,
  };
  const row: React.CSSProperties = {
    position: "relative",
    display: "flex",
    gap: 2,
  };
  const cell: React.CSSProperties = {
    width: "50%",
    overflow: "hidden",
    borderRadius: "27.5%",
  };
  return (
    <div style={column} {...props}>
      <div style={row}>
        <div style={cell}>{<MiniPay />}</div>
        <div style={cell}>{<Rainbow />}</div>
      </div>
      <div style={row}>
        <div style={cell}>{<Coinbase />}</div>
        <div style={cell}>{<Phantom />}</div>
      </div>
    </div>
  );
};

export const SquircleIcon = ({
  icon,
  alt,
}: {
  icon: string | React.ComponentType<any>;
  alt: string;
}) => {
  const IconComponent =
    typeof icon === "string" ? (
      <img src={icon} alt={alt} />
    ) : (
      React.createElement(icon)
    );

  return (
    <div style={{ borderRadius: "22.5%", overflow: "hidden" }}>
      {IconComponent}
    </div>
  );
};

